// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721BurnableUpgradeable.sol";

import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/utils/CountersUpgradeable.sol";

/// @custom:security-contact jack@aizaworld.com
contract Characters is
    Initializable,
    ERC721Upgradeable,
    ERC721EnumerableUpgradeable,
    ERC721URIStorageUpgradeable,
    PausableUpgradeable,
    AccessControlUpgradeable,
    ERC721BurnableUpgradeable
{
    using CountersUpgradeable for CountersUpgradeable.Counter;

    bytes32 public constant GAME_ADMIN = keccak256("GAME_ADMIN");
    bytes32 public constant NO_OWNED_LIMIT = keccak256("NO_OWNED_LIMIT");
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");

    CountersUpgradeable.Counter private _tokenIdCounter;
    uint256 public characterLimit;

    struct CharacterExt {
        uint8 rarity;
        uint16 exp; // Exp to next level
        uint8 level; // Up to 256 cap
        uint8 trait; // Trait
        uint64 staminaTimestamp; // Standard timestamp in seconds-resolution marking regen start from 0
    }

    mapping(uint256 => CharacterExt) public tokensInfoExt;

    /// Events
    event NewCharacter(
        uint256 indexed tokenID,
        address receiver,
        uint8 indexed rarity,
        address indexed minter
    );

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() initializer {}

    function initialize() public initializer {
        __ERC721_init("BowMaster Character", "BMC");
        __ERC721Enumerable_init();
        __ERC721URIStorage_init();
        __Pausable_init();
        __AccessControl_init();
        __ERC721Burnable_init();

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(GAME_ADMIN, msg.sender);
        _grantRole(PAUSER_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
        _grantRole(NO_OWNED_LIMIT, msg.sender);

        characterLimit = 4;
    }

    function _baseURI() internal pure override returns (string memory) {
        return "https://assets.aizaworld.com/bowmaster/";
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    modifier restricted() {
        _restricted();
        _;
    }

    function _restricted() internal view {
        require(hasRole(GAME_ADMIN, msg.sender), "Characters: Not game admin");
    }

    function mintBatch(
        address receiver,
        uint8 rarity,
        uint16 mintAmount,
        string memory uri
    ) public onlyRole(MINTER_ROLE) returns (uint16) {
        require(rarity >= 0 && rarity <= 2, "SupplyBoxs: Rarity invalid");

        for (uint16 i = 0; i < mintAmount; i++) {
            mintWithRarity(msg.sender, receiver, rarity, uri);
        }

        return mintAmount;
    }

    function mintWithRarity(
        address minter,
        address receiver,
        uint8 rarity,
        string memory uri
    ) public onlyRole(MINTER_ROLE) returns (uint256) {
        require(rarity >= 0 && rarity <= 2, "SupplyBoxs: Rarity invalid");

        uint256 tokenID = _tokenIdCounter.current();

        uint16 xp = 0;
        uint8 level = 0; // 1
        uint8 trait = 0; // uint8(RandomUtil.randomSeededMinMax(0, 3, seed));
        uint64 staminaTimestamp = 0;

        tokensInfoExt[tokenID] = CharacterExt(
            rarity,
            xp,
            level,
            trait,
            staminaTimestamp
        );

        uint256 mintedTokenID = safeMint(receiver, uri);

        emit NewCharacter(mintedTokenID, receiver, rarity, minter);

        return mintedTokenID;
    }

    function safeMint(address to, string memory uri)
        public
        onlyRole(MINTER_ROLE)
        returns (uint256)
    {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        _safeMint(to, tokenId);
        _setTokenURI(tokenId, uri);
        return tokenId;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    )
        internal
        override(ERC721Upgradeable, ERC721EnumerableUpgradeable)
        whenNotPaused
    {
        if (
            to != address(0) &&
            to != address(0x000000000000000000000000000000000000dEaD) &&
            !hasRole(NO_OWNED_LIMIT, to)
        ) {
            require(
                balanceOf(to) < characterLimit,
                "Characters: the address owne too many characters"
            );
        }

        super._beforeTokenTransfer(from, to, tokenId);
    }

    // The following functions are overrides required by Solidity.
    function _burn(uint256 tokenId)
        internal
        override(ERC721Upgradeable, ERC721URIStorageUpgradeable)
    {
        // TODO: Delete mapping

        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721Upgradeable, ERC721URIStorageUpgradeable)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(
            ERC721Upgradeable,
            ERC721EnumerableUpgradeable,
            AccessControlUpgradeable
        )
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    function getRarityById(uint256 id) public view returns (uint8 rarity) {
        CharacterExt memory s = tokensInfoExt[id];
        return (s.rarity);
    }

    function getOwnedTokenID(address user)
        public
        view
        returns (uint256[] memory)
    {
        uint256[] memory tokenList = new uint256[](balanceOf(user));
        for (uint256 i = 0; i < tokenList.length; i++) {
            tokenList[i] = tokenOfOwnerByIndex(user, i);
        }

        // TODO: return extra info
        return tokenList;
    }

    function getTrait(uint256 id) public view returns (uint8) {
        return tokensInfoExt[id].trait;
    }

    function setTrait(uint256 id, uint8 trait) public {
        tokensInfoExt[id].trait = trait;
    }

    function getLevel(uint256 id) public view returns (uint8) {
        return tokensInfoExt[id].level; // this is used by dataminers and it benefits us
    }

    function setCharacterLimit(uint256 max) public {
        characterLimit = max;
    }
}
